import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import NavBar from '../components/NavBar';
import { Login } from '../screens/login/login';
import { EsqueciSenha } from '../screens/esqueciSenha/EsqueciSenha';
import CreateAdvogado from '../screens/createAdvogado/CreateAdvogado';
import UpdateAdvogado from '../screens/updateAdvogado/UpdateAdvogado';
import DeleteAdvogado from '../screens/deleteAdvogado/DeleteAdvogado';
import ListarUsuario from '../screens/listarUsuarios/ListarUsuarios';

function AppRoutes() {
    return (
        <Router>
            <Routes>
                {/* Rota para o Login (sem Autenticação) */}
                <Route path="/" element={<Login />} />

                {/* Rota para EsqueciSenha (sem Autenticação) */}
                <Route path="/pagina/esqueci-minha-senha" element={<EsqueciSenha />} />

                {/* Rota para sessão protegida (com Autenticação) */}
                <Route path="/sessao/*">
                    <NavBar /> {/* NavBar dentro do AuthProvider */}
                    <Routes>
                        <Route path="/sessao/createAdvogado" element={<CreateAdvogado />} />
                        <Route path="/sessao/listarUsuarios" element={<ListarUsuario />} />
                        <Route path="/sessao/updateAdvogado" element={<UpdateAdvogado />} />
                        <Route path="/sessao/deleteAdvogado" element={<DeleteAdvogado />} />
                    </Routes>
                </Route>
            </Routes>
        </Router>
    );
}

export default AppRoutes;
